import React,{Component} from "react";
import View from "./View";
import faker from "faker";
import ApprovalCard from "./Components/ApprovalCard";


class App extends Component {
  render() {
    return (
        <React.Fragment>
          <div className="ui container comments fontify ">
            <ApprovalCard>
              <View
                  Username="Drake"
                  UserText="Fuck your mother"
                  img={faker.image.avatar()}
              />
            </ApprovalCard>

            <ApprovalCard>
              <View Username="Sam" UserText="Fuck of" img={faker.image.avatar()} />
            </ApprovalCard>

            <ApprovalCard>
              <div className="fontify">Are you sure</div>
            </ApprovalCard>
          </div>
        </React.Fragment>
    );
  }


}
export default App;
